import React, { useState } from 'react'
import { useRouter } from 'next/router'
const CreateGens = () => {
    const route = useRouter();
    // const [checking, setChecking] = useState(false)

    const count = 0;
    const handleCheck = e => {
        if (e.target.checked == true) {
            count++;
        }
        else {
            count--;
        }
    }
    console.log(count);
    return (
        <div style={{ margin: 80 }}>
            Create {route.query.createGenCompetId}
            <form action="">
                <label>
                    <input type="checkbox" name="type" value="ประชาชน" onChange={handleCheck} />
                    ประชาชน
                </label>
            </form>
        </div>
    )
}
export default CreateGens
